import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';


class List extends Component {

    static defaultProps = {
        content: "",
        itemArr: []
    }

    render() {
        const {
            name, phone, id
        } = this.props.info;

        return (
            <div>
                <div><b>{name}</b></div>
                <div>{phone}</div>
            </div>
        );

    }
}


export default List;
